pragma solidity ^0.8.26;

interface IMessaging {
    // Message structure
    struct Message {
        bytes32 commitment;      // Message commitment
        bytes32 nullifier;       // Uniqueness nullifier
        address sender;          // Sender address
        address recipient;       // Recipient address
        bytes encryptedContent;  // Encrypted message content
        uint256 timestamp;       // Message timestamp
        bool isRead;            // Read status
        bytes32 messageHash;     // Hash of the original message
        bytes proof;            // ZK proof
    }

    /**
     * @notice Send a message to a recipient
     * @param recipient Recipient address
     * @param encryptedMessage Encrypted message content
     * @param messageHash Hash of the original message
     */
    function sendMessage(
        address recipient,
        bytes calldata encryptedMessage,
        bytes32 messageHash
    ) external;

    /**
     * @notice Mark message as read
     * @param commitment Message commitment
     */
    function markMessageRead(bytes32 commitment) external;

    /**
     * @notice Get user's messages with pagination
     * @param user User address
     * @param offset Starting index
     * @param limit Maximum number of messages to return
     */
    function getUserMessages(
        address user,
        uint256 offset,
        uint256 limit
    ) external view returns (Message[] memory);

    /**
     * @notice Get message by commitment
     * @param commitment Message commitment
     */
    function getMessage(bytes32 commitment) 
        external 
        view 
        returns (Message memory);

    // Events
    event MessageSent(
        bytes32 indexed commitment,
        address indexed sender,
        address indexed recipient,
        bytes32 messageHash,
        uint256 timestamp
    );

    event MessageRead(
        bytes32 indexed commitment,
        address indexed recipient,
        uint256 timestamp
    );
}

